 void MapHitChk(){

	 int i,j;//ループ用
	 //当たり判定四隅座標
	 

	 for (i = 0; i < MAP_BH; i++){
		 for (j = 0; j < MAP_BW; j++){

			//初期化
			  mhit3_posX[i][j]=-100;
			 mhit3_posY[i][j]=-100;
			map_ItemHitPos_X[i][j]=-100;//マップアイテム　の場所の左上のX座標
			 map_ItemHitPos_Y[i][j]=-100;//マップアイテム　の場所の左上のY座標

			 map_EvtHitPos_X[i][j]=-100;//マップイベント　の場所の左上のX座標
			  map_EvtHitPos_Y[i][j]=-100;//マップイベント　の場所の左上のY座標
			  


			 if (mhit3[i][j] == 1  ){//当たり判定があったら
				 mhit3_posX[i][j]=map.Chip * j;
				 mhit3_posY[i][j]=map.Chip*i;
				 
			 }

			 if(map_ItemHit[i][j]==1 ){

				  mhit3_posX[i][j]=map.Chip * j;
				 mhit3_posY[i][j]=map.Chip*i;

				 map_ItemHitPos_X[i][j]=map.Chip * j;
				 map_ItemHitPos_Y[i][j]=map.Chip*i;

				
			 }

			 if(map_Evt2_Hit[i][j]==1 ){

				 mhit3_posX[i][j]=map.Chip * j;
				 mhit3_posY[i][j]=map.Chip*i;

				 map_EvtHitPos_X[i][j]= map.Chip * j;
				 map_EvtHitPos_Y[i][j]=map.Chip*i;
				 

			 }

		 }
	 }


 }

 

